import './App.css';
import React from 'react';

class Professores extends React.Component
{
  readProfs()
  {
    var response = fetch('https://sigaa.ifsc.edu.br/sigaa/public/curso/lista.jsf');
    console.log(response);
    return [ { id:1,name:'Arliones'}, {id: 2, name:'Odilson'}];
  }
  render()
  {
    var profs = this.readProfs();

    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {profs.map((prof) => (
            <li key={prof.id}>{prof.name}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
